commit.message:
New template "og-image"

Many comics these days include their image as part of the og:image
property on their webpage. This template makes it possible to easily
extract those. All you need is to specify the URL and the template name.

For example:

$COMIC{little_gamers} = {
    Title => 'Little Gamers',
    Page => 'https://www.little-gamers.com/',
    Template => "og-image",
};
